def separate_paren_groups(paren_string: str) -> List[str]:
    stack = []
    groups = []
    i = 0
    while i < len(paren_string):
        if paren_string[i] == '(':
            stack.append(i)
        elif paren_string[i] == ')':
            if not stack:
                raise ValueError("Unbalanced parentheses")
            start = stack.pop()
            if not stack:
                groups.append(paren_string[start:i+1])
        i += 1
    if stack:
        raise ValueError("Unbalanced parentheses")
    return groups

