def parse_music(music_string: str) -> List[int]:
    notes = {'o': 4, 'o|': 2, '.|': 1}
    beats = []
    i = 0
    while i < len(music_string):
        if music_string[i] == ' ':
            i += 1
            continue
        if i < len(music_string) - 1 and music_string[i:i+2] in notes:
            note = music_string[i:i+2]
            i += 2
        else:
            note = music_string[i]
            i += 1
        beats.append(notes[note])
    return beats

