    """Create a function encrypt that takes a string as an argument and
    returns a string encrypted with the alphabet being rotated. 
    The alphabet should be rotated in a manner such that the letters 
    shift down by two multiplied to two places.
    For example:
    encrypt('hi') returns 'lm'
    encrypt('asdfghjkl') returns 'ewhjklnop'
    encrypt('gf') returns 'kj'
    encrypt('et') returns 'ix'
    """

    # Create a dictionary to store the rotated alphabet
    rotated_alphabet = {}
    alphabet = "abcdefghijklmnopqrstuvwxyz"
    for i in range(len(alphabet)):
        if i < 2:
            rotated_alphabet[alphabet[i]] = alphabet[i+2]
        elif i < 4:
            rotated_alphabet[alphabet[i]] = alphabet[i-2]
        else:
            rotated_alphabet[alphabet[i]] = alphabet[i-4]

    # Create an empty string to store the encrypted string
    encrypted_string = ""

    # Loop through the input string and replace each character with its corresponding rotated character
    for char in s:
        if char in rotated_alphabet:
            encrypted_string += rotated_alphabet[char]
        else:
            encrypted_string += char

    return encrypted_string

