def exchange(lst1, lst2):
    """In this problem, you will implement a function that takes two lists of numbers,
    and determines whether it is possible to perform an exchange of elements
    between them to make lst1 a list of only even numbers.
    There is no limit on the number of exchanged elements between lst1 and lst2.
    If it is possible to exchange elements between the lst1 and lst2 to make
    all the elements of lst1 to be even, return "YES".
    Otherwise, return "NO".
    For example:
    exchange([1, 2, 3, 4], [1, 2, 3, 4]) => "YES"
    exchange([1, 2, 3, 4], [1, 5, 3, 4]) => "NO"
    It is assumed that the input lists will be non-empty.
    """
    even_nums = 0
    odd_nums = 0
    for num in lst1:
        if num % 2 == 0:
            even_nums += 1
        else:
            odd_nums += 1
    for num in lst2:
        if num % 2 == 0:
            even_nums += 1
        else:
            odd_nums += 1
    if odd_nums == 0:
        return "YES"
    elif (odd_nums - even_nums) % 2 == 0:
        return "YES"
    else:
        return "NO"

def histogram(test):
    """
    Given a string representing a space separated lowercase letters,
    return a dictionary of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}
    """

    # If the string is empty, return an empty dictionary
    if not test:
        return {}

    # Convert the string to a list of characters
    lst = list(test)

    # Create an empty dictionary to store the count of each character
    count_dict = {}

    # Iterate through each character in the list
    for char in lst:
        # If the character is already in the dictionary, increment its count by 1
        if char in count_dict:
            count_dict[char] += 1
        # If the character is not in the dictionary, add it and set its count to 1
        else:
            count_dict[char] = 1

    # Create an empty dictionary to store the letter with the most repetition and its count
    result_dict = {}

    # Find the maximum count of any character in the count_dict
    max_count = max(count_dict.values())

    # Iterate through each key-value pair in the count_dict
    for key, value in count_dict.items():
        # If the value is equal to the maximum count, add the key to the result_dict with its corresponding value
        if value == max_count:
            result_dict[key] = value

    return result_dict

