def intersection(interval1, interval2):
    """
    You are given two intervals, where each interval is a pair of integers.
    Your task is to determine whether the length of intersection of these two intervals is a prime number.
    If the length of the intersection is a prime number, return "YES", otherwise, return "NO".
    If the two intervals don't intersect, return "NO".
    """
    start1, end1 = interval1
    start2, end2 = interval2
    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)
    intersection_length = intersection_end - intersection_start
    if intersection_length > 0 and is_prime(intersection_length):
        return "YES"
    else:
        return "NO"

def minPath(grid, k):
    n = len(grid)
    visited = set()
    lst = []
    def dfs(x, y, k):
        if k == 0:
            lst.append([grid[i][j] for i, j in visited])
            return
        visited.add((x, y))
        for i, j in [(x-1, y), (x+1, y), (x, y-1), (x, y+1)]:
            if 0 <= i < n and 0 <= j < n and (i, j) not in visited:
                dfs(i, j, k-1)
        visited.remove((x, y))
    dfs(0, 0, k)
    return min(lst)

