def right_angle_triangle(a, b, c):
    if a**2 == b**2 + c**2:
        return True
    elif b**2 == a**2 + c**2:
        return True
    elif c**2 == a**2 + b**2:
        return True
    else:
        return False

def right_angle_triangle(a, b, c):
    '''
    Given the lengths of the three sides of a triangle. Return True if the three
    sides form a right-angled triangle, False otherwise.
    A right-angled triangle is a triangle in which one angle is right angle or 
    90 degree.
    Example:
    right_angle_triangle(3, 4, 5) == True
    right_angle_triangle(1, 2, 3) == False
    '''
    # Find the longest side
    sides = sorted([a, b, c])
    longest = sides[-1]

    # Check if the longest side satisfies the Pythagorean theorem
    if longest == a:
        return (b**2 + c**2 == a**2)
    elif longest == b:
        return (a**2 + c**2 == b**2)
    else:
        return (a**2 + b**2 == c**2)

def find_max(words):
    """
    This function accepts a list of strings and returns the word with maximum number of unique characters.
    If multiple strings have maximum number of unique characters, it returns the one which comes first in lexicographical order.
    """

    max_word = ""
    max_count = 0

    for word in words:
        unique_chars = set(word)
        if len(unique_chars) > max_count:
            max_count = len(unique_chars)
            max_word = word
        elif len(unique_chars) == max_count:
            if word < max_word:
                max_word = word

    return max_word

def do_algebra(operator, operand):
    # Initialize the expression with the first operand
    expression = str(operand[0])

    # Iterate over the remaining operands and operators
    for i in range(1, len(operand)):
        # Add the operator and the current operand to the expression
        expression += operator[i-1] + str(operand[i])

    # Evaluate the expression and return the result
    return eval(expression)

